pragma solidity 0.5.7;

contract Logger {
  function log(
    string memory message
  ) public pure {}

  function log(
    string memory message,
    uint256 arg2
  ) public pure {}

  function log(
    string memory message,
    uint256 arg2,
    uint256 arg3
  ) public pure {}

  function log(
    string memory message,
    uint256 arg2,
    uint256 arg3,
    uint256 arg4
  ) public pure {}

  function log(
    string memory message,
    uint256 arg2,
    uint256 arg3,
    uint256 arg4,
    uint256 arg5
  ) public pure {}

  function log(
    string memory message,
    uint256 arg2,
    uint256 arg3,
    uint256 arg4,
    uint256 arg5,
    address arg6
  ) public pure {}


  function log(
    string memory message,
    uint256 arg2,
    uint256 arg3,
    uint256 arg4,
    uint256 arg5,
    address arg6,
    address arg7
  ) public pure {}


  function log(
    string memory message,
    uint256 arg2,
    uint256 arg3,
    uint256 arg4,
    uint256 arg5,
    address arg6,
    address arg7,
    address arg8
  ) public pure {}

  function log(
    string memory message,
    uint256 arg2,
    uint256 arg3,
    uint256 arg4,
    uint256 arg5,
    address arg6,
    address arg7,
    address arg8,
    address arg9
  ) public pure {}
}
